BEGIN;

CREATE TABLE Participants (
    ParticipantEmail VARCHAR(150),
    ParticipantFirstName VARCHAR(50),
    ParticipantLastName VARCHAR(50),
    ParticipantDOB VARCHAR(100),
    ParticipantRole VARCHAR(100),
    ParticipantPhone VARCHAR(20),
    ParticipantCity VARCHAR(60),
    ParticipantState CHAR(2),
    ParticipantZip VARCHAR(10),
    ParticipantSchoolOrEmployer VARCHAR(120),
    ParticipantFieldOfInterest VARCHAR(120),
    ParticipantID INT PRIMARY KEY
);


CREATE TABLE EventTemplates (
    EventName VARCHAR(120),
    EventType VARCHAR(60),
    EventDescription VARCHAR(200),
    EventRecurrencePattern VARCHAR(60),
    EventDefaultCapacity VARCHAR(60),
    EventTemplateID INT PRIMARY KEY
);


CREATE TABLE EventOccurrences (
    EventName VARCHAR(120),
    EventDateTimeStart TIMESTAMP,
    EventDateTimeEnd TIMESTAMP,
    EventLocation VARCHAR(120),
    EventCapacity VARCHAR(60),
    EventRegistrationDeadline TIMESTAMP,
    EventTemplateID INT PRIMARY KEY,
    EventOccurrenceID INT PRIMARY KEY,
    FOREIGN KEY (EventTemplateID) REFERENCES EventTemplates(EventTemplateID)
);


CREATE TABLE Registrations (
    ParticipantEmail VARCHAR(150),
    EventName VARCHAR(120),
    EventDateTimeStart TIMESTAMP,
    RegistrationStatus VARCHAR(50),
    RegistrationAttendedFlag VARCHAR(100),
    RegistrationCheckInTime TIMESTAMP,
    RegistrationCreatedAt TIMESTAMP,
    ParticipantID INT PRIMARY KEY,
    EventOccurrenceID INT PRIMARY KEY,
    RegistrationID INT PRIMARY KEY,
    FOREIGN KEY (ParticipantID) REFERENCES Participants(ParticipantID),
    FOREIGN KEY (EventOccurrenceID) REFERENCES EventOccurrences(EventOccurrenceID)
);


CREATE TABLE Surveys (
    ParticipantEmail VARCHAR(150),
    EventName VARCHAR(120),
    EventDateTimeStart TIMESTAMP,
    SurveySatisfactionScore INT,
    SurveyUsefulnessScore INT,
    SurveyInstructorScore INT,
    SurveyRecommendationScore INT,
    SurveyOverallScore INT,
    SurveyNPSBucket VARCHAR(100),
    SurveyComments TEXT,
    SurveySubmissionDate DATE,
    ParticipantID INT PRIMARY KEY,
    EventOccurrenceID INT PRIMARY KEY,
    RegistrationID INT PRIMARY KEY,
    SurveyID INT PRIMARY KEY,
    FOREIGN KEY (RegistrationID) REFERENCES Registrations(RegistrationID)
);


CREATE TABLE Milestones (
    ParticipantEmail VARCHAR(150),
    MilestoneTitle VARCHAR(150),
    MilestoneDate DATE,
    ParticipantID INT PRIMARY KEY,
    MilestoneID INT PRIMARY KEY,
    FOREIGN KEY (ParticipantID) REFERENCES Participants(ParticipantID)
);


CREATE TABLE Donations (
    ParticipantEmail VARCHAR(150),
    DonationDate DATE,
    DonationAmount REAL,
    ParticipantID INT PRIMARY KEY,
    DonationID INT PRIMARY KEY,
    FOREIGN KEY (ParticipantID) REFERENCES Participants(ParticipantID)
);


COMMIT;
